          "Location":"Ni\u015fanta\u015f\u0131",
          "Body":"<p id=\"\">Solo Mimarl\u0131k olarak mekan\u0131n tasar\u0131m ve teknik \u00e7izim \u00e7al\u0131\u015fmalar\u0131n\u0131 \u00fcstlendik ve projenin uygulamas\u0131n\u0131 y\u00fcr\u00fctt\u00fck. Projeyi geli\u015ftirirken, farkl\u0131 \u00e7izgilere sahip modern ve klasik tasar\u0131m yakla\u015f\u0131mlar\u0131n\u0131n tek bir mekanda harmoni i\u00e7inde bulu\u015ftu\u011funu hayal ettik. T\u0131pk\u0131 do\u011fa gibi kucaklay\u0131c\u0131 ve huzur veren mekanlar olu\u015fturmak istedik. Ekibimiz taraf\u0131ndan mekana \u00f6zel olarak tasarlanan her bir par\u00e7a bu anlay\u0131\u015f do\u011frultusunda geli\u015fti. Do\u011fadan ilham alan pastel renkler ve organik bi\u00e7imler, do\u011fal ah\u015fap ve mermer dokular mekan\u0131n dilini olu\u015fturdu. </p><p id=\"\">CEPHE</p><p id=\"\">Binan\u0131n d\u0131\u015f cephesinde showroom alan\u0131ndan soka\u011fa bakan vitrinin sergilenece\u011fi, do\u011fal mermer bloklar ile \u00e7evrelenen cam bir cephe tasarlad\u0131k. Marka ad\u0131 ve logosunu cephe \u00fczerine i\u015fleyip \u0131\u015f\u0131kland\u0131rarak uygulamam\u0131z\u0131 tamamlad\u0131k.</p><p id=\"\">G\u0130R\u0130\u015e</p><p id=\"\">Misafirleri kar\u015f\u0131layan ah\u015fap giri\u015f kap\u0131s\u0131 i\u00e7in lotus \u00e7i\u00e7e\u011fi ve yapraklarla s\u00fcslenen \u00f6zel bir f\u0131r\u0131nlanm\u0131\u015f renkli cam tasarlad\u0131k. </p><p id=\"\">SHOWROOM</p><p id=\"\">Mekanda do\u011fal ve yuvarlak hatlar olu\u015fturmak istedik. Tasarlad\u0131\u011f\u0131m\u0131z \u00f6zel kal\u0131plarla k\u00f6\u015fesiz bir duvar uygulamas\u0131 yapt\u0131k. Dairesel \u00e7izgilere sahip ni\u015fler ile duvar i\u00e7inde \u00fcr\u00fcn sergileme alanlar\u0131 ve depolama alanlar\u0131 olu\u015fturduk. Mekana \u00f6zel mermer ve pirin\u00e7 malzemeyi birlikte kulland\u0131\u011f\u0131m\u0131z sabit ve hareketli ask\u0131lar tasarlad\u0131k. Vitrin ve kabin olarak kullan\u0131lacak alan\u0131 bir platformla y\u00fckselterek zeminden ay\u0131rd\u0131k. Zeminde do\u011fal mermer ve \u00e7ak\u0131l uygulamas\u0131yla tasar\u0131m\u0131m\u0131z\u0131 tamamlad\u0131k. </p><p id=\"\">KULLANIM ALANLARI</p><p id=\"\">Mekanda do\u011fa etkisini hissettirmek amac\u0131yla; duvarlarda ve mobilyalarda mavi, ye\u015fil ve toprak tonlar\u0131nda renkler tercih ettik. Zeminde; koridor ve \u0131slak hacimlerde seramik uygulamas\u0131, di\u011fer alanlarda ise mevcut ah\u015fap parkeleri koruyarak sistre uygulamas\u0131 yapt\u0131k. <br>Mutfak alan\u0131 i\u00e7in tasarlad\u0131\u011f\u0131m\u0131z me\u015fe kaplama mobilyalar ve se\u00e7ti\u011fimiz do\u011fal ah\u015fap jaluziler ile tasar\u0131m\u0131m\u0131z\u0131 destekledik. Koridor, mutfak ve ofis mekanlar\u0131na lambiri duvar kaplamalar\u0131 uygulad\u0131k. At\u00f6lye alanlar\u0131 i\u00e7in \u00e7al\u0131\u015fma masalar\u0131 ve dolaplar tasarlad\u0131k. Ortak kullan\u0131ml\u0131 tuvalet i\u00e7in tasar\u0131m ekibimizle birlikte \u00f6zg\u00fcn bir duvar resmi \u00e7al\u0131\u015fmas\u0131 yapt\u0131k. Ofis alan\u0131nda rustik tarzda ah\u015fap bir \u00e7al\u0131\u015fma masas\u0131 ile birlikte heykelsi bir mermer ayakla ta\u015f\u0131nan yuvarlak cam tablal\u0131 bir toplant\u0131 masas\u0131 tasarlad\u0131k. Dairesel hatlara sahip ah\u015fap ayakl\u0131 bir dolap ve do\u011fal \u00e7izgili tasar\u0131m anlay\u0131\u015f\u0131m\u0131z\u0131 s\u00fcrd\u00fcren organik bi\u00e7imli bir koltuk tasar\u0131m\u0131yla mekan\u0131 tamamlad\u0131k.</p><p id=\"\">\u200d</p>",
